class Costanti {

    static get ALL() {
        return "all";
    }

    static get PARTENZA() {
        return "partenza";
    }

    static get ARRIVO() {
        return "arrivo";
    }

    static get ORARIO() {
        return "orario";
    }

}

export default Costanti;
